import './Chats.css';
import Chat from "./Chat";

function Chats(){
    return (
        <div className="chats">
            <Chat name="Sayuri"
            message="Hey sweetie!"
            timestamp="40 seconds ago"
            profilePic=""/>
        </div>
    );
}

export default Chats;
